@easyJet tengo tres vuelos cancelados por covid19 y quiero un reembolso. El formulario web no funciona y no atienden el teléfono 902 al que solo dan opción de llamar. 
Cómo hago para pedir el reembolso?
#COVID19

 Conocedora de que la crisis #COVID19 está golpeando fuertemente en materia de vivienda, la Consejería de Infraestructuras, Urbanismo y Deporte sigue trabajando en:

 flexibilizar los criterios de ayuda al alquiler;

 lanzar una convocatoria extraordinaria de ayudas;

